import 'vuetify/dist/vuetify.min.css';
import '@mdi/font/css/materialdesignicons.css';


// src/main.js
import { createApp } from 'vue';
import App from './App.vue';
import router from './router';
import './assets/styles.css';

const app = createApp(App);
app.use(vuetify);
app.use(router);
app.mount('#app');
